-- ----------------------------
-- Table structure for app_tables
-- ----------------------------
DROP TABLE IF EXISTS `app_tables`;
CREATE TABLE `app_tables` (
  `app_id` bigint NOT NULL COMMENT '应用ID',
  `items` varchar(255) NOT NULL COMMENT '项目',
  `sort` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '分类(0自研 1外采)',
  `server` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '服务器',
  `network` varchar(255) NOT NULL COMMENT '网络',
  `domain` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '域名',
  `pl` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '开发语言',
  `frame` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '框架',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '更新者',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  `element` varchar(255) NOT NULL COMMENT '组件',
  `lifecycle` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '生命周期(0在用 1下架)',
  `data_center` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '数据中心(0生产机房 1测试机房 2公有云)',
  `risk_eval` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '风险评估(0已评估 1未评估 2待评估)',
  `risk_level` char(1) NOT NULL COMMENT '风险等级(0高 1中 2低)',
  `sec_acl` varchar(255) NOT NULL COMMENT '访问控制策略',
  `sec_safety` varchar(255) NOT NULL COMMENT '安全控制'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='应用资产表';

